Achtervolgd door een tragische gebeurtenis uit haar verleden, ontsnapt de fotojournalist Sara Frost aan de wereld in een chique penthouse in New York. Maar de wereld komt haar achterna in de vorm van de wraakzuchtige, sadistische crimineel Hollander die op zoek is naar een fortuin aan gestolen diamanten die verborgen liggen in het appartement. Gevangen en buitengesloten van de wereld moet Sara de kracht vinden om een eindeloze nacht van fysieke en psychische marteling te overleven.



